var housing_map = L.map('housing_map').setView([42.277, -83.736], 15);

L.tileLayer('http://{s}.tile.osm.org/{z}/{x}/{y}.png', {
    attribution: '&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
}).addTo(housing_map);

function getColor(d) {
    return d > 9000 ? '#b4df21'  :
           d > 1000 ? '#dfab21'  :
           d > 900  ? '#df4c21'  :
           d > 850  ? '#df2155'  :
           d > 800  ? '#df21b4'  :
           d > 750  ? '#ab21df'  :
           d > 700  ? '#4c21df'  :
           d > 650  ? '#2155df'  :
           d > 600  ? '#21b4df'  :
                      '#21dfab';
}

function style(feature) {
    return {
        radius: 7,
        fillColor: getColor(feature.properties.rent_per_person),
        color: getColor(feature.properties.rent_per_person),
        weight: 1,
        opacity: .6,
        fillOpacity: 0.7
    };
};

L.geoJson(smtr_data, {
    style: style,

    pointToLayer: function (feature, latlng) {
        return L.circleMarker(latlng, {radius: 7, fillOpacity: .7});
    },
    onEachFeature: function (feature, layer) {
        layer.bindPopup("Address: " + feature.properties.address + "\n"
            + "Bedrooms: " + feature.properties.bedrooms + "\n"
            + "Total Rent: $" + feature.properties.rent + "\n"
            + "Rent Per Person: $" + feature.properties.rent_per_person + "\n"
            + "Link: " + feature.properties.contact);
    }
}).addTo(housing_map);

var info = L.control();

info.onAdd = function(housing_map) {
    this._div = L.DomUtil.create('div', 'info');
    this.update();
    return this._div;
}

info.update = function(props) {
    this._div.innerHTML = '<h3>Ann Arbor Off-Campus Housing 2017 - 2018</h3> \n'
                          + '<h4>Residence Color Denotes Rent Per Person '
                          + 'Per Month </h4> \n click on a point for its '
                          + 'address, number of bedrooms, rent, & a link to '
                          + 'the listing';
}

info.addTo(housing_map);

var legend = L.control({position: 'bottomright'});

legend.onAdd = function(map) {
    var div = L.DomUtil.create('div', 'info legend'),
        grades = [0, 600, 650, 700, 750, 800, 850, 900, 1000, 9000]
        labels = [];

    for (var i = 0; i < grades.length; i++) {
        div.innerHTML +=
        '<i style = "background:' + getColor(grades[i] + 1) + '"></i> $' +
        grades[i] + (grades[i + 1] ? ' &ndash; $' + grades[i + 1] + '<br>' : '+');
    }

    return div;
};

legend.addTo(housing_map);
